import React, { Component } from 'react';

import "./Card.css";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="card">
        <div className="card-projectName">{this.props.projectName}</div>
        <div>{this.props.intro}</div>
        <button>Detail</button>
      </div>
    );
  }
}

export default Card;
